import React, {useState} from 'react';
import Header from './Header'

function App() {
    let [counter,setCounter] = useState(0)

    function increment(){
      setCounter(counter++)
      Console.log(counter)
    } 
    return(
      <div>
      <Header>Contador: {counter}</Header> 
      <button onClick={increment}>INCREMENTAR</button>
      </div>
    )
}

export default App;
